import React from "react";
import { Link } from "react-router-dom";
import navLogo from "../assets/printer-sprite.png"; // import from src/assets
import "../styles.css";


const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="logo">
        <img src={navLogo} alt="printer-sprite" />
        <span>The Money Printer</span>
      </div>
      <div className="nav-links">
        <Link to="/">Home</Link>
        <Link to="/about">About</Link>
        <button className="get-started">Get Started</button>
      </div>
    </nav>
  );
};

export default Navbar;
